define(function () {
    var internals = {};
    var externals = {};

    class Camp{

        constructor(id,name){
            this.id = id;
            this.name = name;
        }
    
    }
    
    let camp1 = new Camp(1,"Loures")
    let camp2 = new Camp(2,"Cascais")
    let camp3 = new Camp(3,"Cona")
    let camp4 = new Camp(4,"LALA")
    let camp5 = new Camp(5,"LALA")
    let camp6 = new Camp(6,"LALA")    
    let camp7 = new Camp(7,"LALA")
    
    internals.camps = [camp1, camp2, camp3,camp4,camp5,camp6,camp7];


    externals.getFields = async (cb) => {
        let fields = await fetch('http://192.168.10.172:8080/goalie/api/fields/');
        
        result = await fields.json();
        console.log(result)
        cb(result);
    };

    externals.getFieldInfo = (cb) =>{
        console.log(`info id:${externals.id}`)
        cb(internals.camps[0].id)
    }


    return externals;
})